import '../styles/Convo.css'
import mock2 from '../assets/solution.png'
import StepsPanel from '../components/StepsPanel'

function Convo() {
    return (
        <main className='Convo'>
            <section className='content'>
                <h1>
                    Introducing Convo
                </h1>
                <img className='convoImage' src={mock2} alt="App Preview 2" />
            </section>
        </main>
    );
}

export default Convo;
